    public function searchBeneficiaryDB($inStr)
    {
        $limit = 10;
        if (empty($inStr)) {
            $query = $this->db->limit($limit)->get('beneficiary_db')->result();
        } else {
            $query = $this->db->like('village_name', $inStr)
                ->or_like('beneficiary_name', $inStr)
                ->get('beneficiary_db')->result();
        }

        $output = '';
        foreach ($query as $value) {
            $output .= '<tr>';
            $output .= '<td> ' . $value->village_name . ' </td>';
            $output .= '<td> ' . $value->beneficiary_name . ' </td>';
            $output .= '<td class="tphoneicon"> ' . $value->phone_no . ' </td>';
            $output .= '<td>' . $value->education_details . ' </td>';
            if ($value->training) {
                $output .= '<td class="peargreen"></td>';
            } else {
                $output .= '<td class="lightorange"></td>';
            }
            $output .= '</tr>';
        }
        return $output;

    }

