    // this table saves the districts in the database and also
    // update the parameter performance table with those districts as columns
    public function saveDistrictDBBatch($data)
    {
        $this->db->insert_batch('district', $data);
        $this->load->dbforge();
        foreach ($data as $row) {
            $name = preg_replace('/\s+/', '_', $row['title']);
            // echo $name;
            $fields = array(
                $name => array(
                    'type' => 'double',
                    'Default' => '0',
                ),
            );

            $this->dbforge->add_column('performance_parameters', $fields);
        }
    }

